import { Link } from 'react-router-dom'
import Image from 'react-bootstrap/Image';

const Navbar = () => {

  return (
    <header>
      <div className="MainNavbar">
        <Link to="/">
          <Image src="holder.js/171x180" rounded />
          <h1>HaggleHouse</h1>
        </Link>
        <Link to="/register"> Login</Link>
      </div>
    </header>
  )
}

export default Navbar
